import React, { Component } from "react";

class Gebäudeliste extends Component {
  constructor(props) {
    super(props); //since we are extending class Table so we have to use super in order to override Component class constructor
    this.state = {
      buildings: [
        {
          id: 1,
          Gebäudenummer: "1",
          Facility: "Klinikum",
          Name: "Klinik-Verwaltung",
          Straße: "Kerpener Str. 68"
        },
        {
          id: 2,
          Gebäudenummer: "2",
          Facility: "Klinikum",
          Name: "Wohnheim",
          Straße: "Gleuler Str. 88a"
        },
        {
          id: 3,
          Gebäudenummer: "2a",
          Facility: "Klinikum",
          Name: "Klinikum-Verwaltung",
          Straße: "Gleueler Str. 88a"
        },
        {
          id: 4,
          Gebäudenummer: "3",
          Facility: "Klinikum",
          Name: "Strahlentherapie",
          Straße: "Kerpener Str. 62"
        },
        {
          id: 5,
          Gebäudenummer: "3a",
          Facility: "Universität",
          Name: "CyberKnife - Zentrum",
          Straße: "Kerpener Str. 62"
        },
        {
          id: 5,
          Gebäudenummer: "3a",
          Facility: "Universität",
          Name: "CyberKnife - Zentrum",
          Straße: "Kerpener Str. 62"
        }
      ]
    };
  }

  highlightOnMap = () => {
    this.props.history.push("/Map");
  };

  renderTableData() {
    return this.state.buildings.map(building => {
      const { id, Gebäudenummer, Facility, Name, Straße } = building; //destructuring
      return (
        <tr key={id} className='tr-hover' onClick={this.highlightOnMap}>
          <td>{id}</td>
          <td>{Gebäudenummer}</td>
          <td>{Facility}</td>
          <td>{Name}</td>
          <td>{Straße}</td>
        </tr>
      );
    });
  }

  render() {
    //Whenever our class runs, render method will be called automatically, it may have already defined in the constructor behind the scene.
    return (
      <div className='dummy'>
        <h2 className='dummyText'>Gebäudeübersicht</h2>
        <div id='container-table'>
          <table class='u-full-width'>
            <thead>
              <tr class='tr-first'>
                <th>Id</th>
                <th>Gebäudenummer</th>
                <th>Klinikum/Universität</th>
                <th>Name/Nutzer</th>
                <th>Straße</th>
              </tr>
            </thead>
            <tbody>{this.renderTableData()}</tbody>
          </table>
        </div>
      </div>
    );
  }
}

export default Gebäudeliste;
